import '@ionic/react/css/text-transformation.css';
import '@ionic/react/css/flex-utils.css';
import '@ionic/react/css/display.css';

/* Theme variables */
import './theme/variables.css';

setupIonicReact();

const App: React.FC = () => {

  /*Calcul et tout ça*/

  return (
  <IonApp>
    <IonHeader>
      <IonToolbar color>
        <IonTitle>Calculateur de Taxes</IonTitle>
      </IonToolbar>
    </IonHeader>
  </IonApp>
  );
};

export default App;
